export declare const enums = "\n  datasource db {\n    provider = \"postgresql\"\n    url      = \"postgresql://localhost:5432/db\"\n  }\n\n  model User {\n    id String @id @default(cuid())\n    name String\n    email String @unique\n    status String\n    nicknames String[]\n    permissions Permission[]\n    favoriteTree Tree\n    location Location\n    posts Post[]\n    someFloats Float[]\n  }\n\n  model Post {\n    id String @id @default(cuid())\n    name String\n    email String @unique\n    createdAt DateTime @default(now())\n    updatedAt DateTime @updatedAt\n  }\n\n  model Test {\n    id String @id @default(uuid())\n    name String\n  }\n\n  model Location {\n    id Int @id\n    city String\n  }\n\n  enum Tree {\n    ARBORVITAE\n    YELLOWBIRCH\n    BLACKASH\n    DOUGLASFIR\n    OAK\n  }\n\n  enum Permission {\n    ADMIN\n    USER\n    OWNER\n    COLLABORATOR\n  }\n";
